import React from 'react'
import './Navbar.css';
import { Link } from "react-router-dom";

function Navbar(){

    return(
        <div className='navbar-container'>
            <div className='navbar-logo'>
                <img className="navbar-logo" src='./images/logo-img.png' />
            </div>
            <div className='navbar-buttons'>
                <div className='navbar-btn  btn-login'>
                    <Link to="/expenses">Login</Link>
                </div>
                <div className='navbar-btn  btn-sign'>
                    <Link to="/expenses">Sign In</Link>
                </div>
            </div>
        </div>
    )
}

export default Navbar;
